import React from 'react';
import Stack from './Stack.js';
import GettingGallery from './GetGallery.js';


export default function Gallery() {
    return (
      <div>
        <div className="TVShowTitles">
          getGallery().map(stack => (
            <Stack
              key={Stack.id}
              id={Stack.id}
              name={Stack.name}
              logo={Stack.logo}
            />
          ));
        </div>
      </div>
    );
  }
